@michellepfeifferofficial is glad #timesup not only exposed sexual harassment but also brought women in hollywood together. her roles have always had strong female parts, but she’s ready for even more more opportunities to collaborate with women, like with angelina jolie and @ellefanning on maleficent 2. “it’s hard to describe the connectedness you feel working with actresses. it’s a different kind of energy and excitement. the efforts now to support each other and to come together have been incredible, but it’s only the beginning, really.” read @robertjhaskell’s full story at the link in bio. | photographed by @benhassett; styled by @juliavonboehm

